function Jobs() {
    const [jobs, setJobs] = useState(["Job_1", "Job_2", "Job_3"]);
    return (
        <div>
           <label>
            Choose a browser from this list:
            <input list="browsers" name="myBrowser" onClick={(e)=>{setJobs([...jobs, e.target.value])}}/>  
            <button onClick= {handl}>Add</button>
        </label>   
        <datalist id="browsers">
            {jobs.map((job, key)=>{
               return  <option key = {key} value = {job} />;
            })}   
        </datalist>
        </div>
    )
}

export default Jobs
